import React from "react";
import {Link} from "react-router-dom";

function HPNavBar(props){
    const style = props.renderNav ? {display: "block"} : { display: "none" };

    return(
        <div style= {style} className="navBar" id="homePageNB">
            <ul id="hpURLList">
                <li><div>hellos</div></li>
                <li className="nvUpperRightOptions"><Link to="/login"><button>Log in</button></Link></li>
                <li className="nvUpperRightOptions"><Link to="/signup"><button>Sign up</button></Link></li>
            </ul>
        </div> 
    );
}

export default HPNavBar;
